import React from "react";

export default ({ id }) => {
    let list;
    if(id == "Acute decompensated heart failure") {
        list = 
        <p>FAILURE<br></br>
        Forgot medication<br></br>
        Anaemia/Ischemia<br></br>
        Infarction/Infection<br></br>
        Lifestyle: taken too much salt<br></br>
        Upregulation of CO: pregnancy, hyperthyroidism<br></br>
        Renal failure<br></br>
        Embolism: pulmonary</p>
    }else if(id == "High anion gap metabolic acidosis"){
        <p>MUDPILES
        Methanol (formic acid)<br></br>
        Uremia<br></br>
        Diabetic ketoacidosis<br></br>
        Propylene glycol<br></br>
        Iron tablets or isoniazid<br></br>
        Lactic acidosis (such as by metformin toxicity)<br></br>
        Ethylene glycol<br></br>
        Salicylates (late)<br></br>
        </p>
    }
    return (
        <article>
            <h1>{id}</h1>
            <p>{list}</p>
        </article>
    );
};
